import { useState, useEffect } from "react";
import "./styles.css";

// Anonymizes an 8-digit phone number, e.g., "81234567" -> "8123 XXXX"
const anonymizePhoneNumber = (number) => {
  return number.substring(0, 4) + " XXXX";
};

// Component to handle description logic
const Description = ({ text }) => {
  const [revealedNumbers, setRevealedNumbers] = useState({});

  const toggleReveal = (index) => {
    setRevealedNumbers((prev) => ({ ...prev, [index]: !prev[index] }));
  };

  // Process text to find, anonymize, and make phone numbers clickable
  const parts = text.split(/(\d{4}\s?\d{4})/g).map((part, index) => {
    if (/^\d{4}\s?\d{4}$/.test(part)) {
      const originalNumber = part.replace(/\s/g, "");
      const isRevealed = revealedNumbers[index];
      return (
        <span
          key={index}
          className="phone-number"
          onClick={() => toggleReveal(index)}
        >
          {isRevealed ? originalNumber : anonymizePhoneNumber(originalNumber)}
        </span>
      );
    }
    // Render newlines as <br>
    return part.split("\n").map((line, i) => (
      <span key={`${index}-${i}`}>
        {line}
        {i < part.split("\n").length - 1 && <br />}
      </span>
    ));
  });

  return <p className="description">{parts}</p>;
};

export default function ListingAd({
  flag,
  arrow_left,
  arrow_right,
  price,
  icon,
  pic,
  title,
  address,
  description,
  availabilities_label,
  subprice_label,
  project_type,
  year,
  ownership_type,
}) {
  const [isDescriptionVisible, setIsDescriptionVisible] = useState(false);
  const [isMounted, setIsMounted] = useState(false);

  useEffect(() => {
    setIsMounted(true);
  }, []);

  const toggleDescription = () => {
    setIsDescriptionVisible(!isDescriptionVisible);
  };

  return (
    <div
      className={`App ${
        isDescriptionVisible ? "description-visible" : ""
      }`}
    >
      <div className="imageContainer">
        {flag && <img className="flag" src={flag} alt="Flag" />}
        <img className="mainPic" src={pic} alt={title} />

        <button className="arrowBtn arrowLeft">
          <img src={arrow_left} alt="Previous" />
        </button>
        <button className="arrowBtn arrowRight">
          <img src={arrow_right} alt="Next" />
        </button>
      </div>
      <div className="mainContent">
        <div className="topContent">
          <div className="leftContent">
            <div className="leftTopContent">
              <img className="icon" width="40" height="40" src={icon} />
              <div className="textLeftTopContent">
                <h1 className="title">{title}</h1>
                <p className="address">{address}</p>
              </div>
            </div>
            <div className="leftBotContent">
              <p className="labelTop">
                {project_type} · {year} · {ownership_type}
              </p>
              <p className="labelBot">{availabilities_label}</p>
            </div>
          </div>

          <div className="rightContent">
            <div className="price">
              <h1>{price}</h1>
            </div>
            <p className="priceFrom">{subprice_label}</p>
          </div>
        </div>

        <div className="bottomContent">
          <button onClick={toggleDescription}>See description</button>
          {isMounted && (
            <div
              className={`description-wrapper ${
                isDescriptionVisible ? "visible" : ""
              }`}
            >
              <Description text={description} />
            </div>
          )}
        </div>
      </div>
    </div>
  );
}
